	"AreYouSurePopupStopSharingButton" : "No compartir",
	"AreYouSurePopupText" : "\u003cp\u003eEsta organización puede compartir de manera segura su registro médico con miembros de su equipo de atención de otras organizaciones. Usted puede elegir limitar nuestra abilidad de compartir su registro médico con su equipo de atención a través de Care Everywhere. Si elige limitar cómo se comparte su registro, puede que su información de salud no esté disponible para sus médicos.\u003c/p\u003e\t \t\u003cp\u003eAun si usted elige limitar el intercambio de su información a través de Care Everywhere, puede que divulguemos su información de salud según otras autorizaciones y según lo autorice la ley.\u003c/p\u003e \t",
