	"RecordSharingFAQHeaders" : "",
	"RecordSharingFAQHeaders_0" : "Su salud es nuestra prioridad",
	"RecordSharingFAQHeaders_1" : "¿Quién puede solicitar mi información?",
	"RecordSharingFAQHeaders_2" : "¿Qué información es compartida?",
	"RecordSharingFAQHeaders_3" : "¿Cómo está protegida mi información?",
	"RecordSharingFAQText" : "",
	"RecordSharingFAQText_0" : "\r\n\t\t\t\t\t\t\u003cp\u003e\r\n\t\t\t\t\t\t\tQueremos ayudarle a encontrar cuidado seguro y eficaz en nuestra organización y otros lugares dónde recibe cuidado. \r\n\t\t\t\t\t\t\tPuede que compartamos su registro con personal médico fuera de esta organización y su plan de cuidado para que su información esté disponible a su equipo de atención. \r\n\t\t\t\t\t\t\tPor ejemplo, puede que compartamos su registro para que sus médicos tengan acceso a su historial médico en caso de urgencia, o para que una especialista suya tenga un imagen claro de su plan de cuidado. \r\n\t\t\t\t\t\t\u003c/p\u003e\r\n\r\n\t\t\t\t\t\t\u003cp\u003e\r\n\t\t\t\t\t\t\tUtilizamos una herramienta llamada Care Everywhere, la cual permite que personal médico de otras organizaciones pueda pedir y intercambiar información importante de su cuidado. Un intercambio seguro y de manera electrónica puede dar su equipo de atención la información que necesita para tomar decisiones informadas sobre su cuidado y podría ayudar a prevenir errores o ayudarle a evitar exámenes o procedimientos innecesarios.\r\n\t\t\t\t\t\t\tEl intercambio electrónico de su registro también puede mejorar su experiencia por reducir la cantidad de información de su registro médico que tiene que recordar, llevar consigo, o enviar a su personal médico.\r\n\t\t\t\t\t\t\u003c/p\u003e\r\n\t\t\t\t\t\t",
	"RecordSharingFAQText_1" : "\r\n\t\t\t\t\t\tLas organizaciones de atención médica que lo identifican como uno de sus pacientes pueden solicitar su registro a nuestra organización.\r\n\t\t\t\t\t\tEsto ayuda a los miembros de su equipo de atención a coordinar los diferentes aspectos de su atención.  \r\n\t\t\t\t\t",
	"RecordSharingFAQText_2" : "\r\n\t\t\t\t\t\t\u003cp\u003eCualquier información en su registro electrónico de salud podría compartirse con fines de tratamiento, incluyendo:\u003c/p\u003e\r\n\r\n\t\t\t\t\t\t\u003cul style=\"padding-left:20px; list-style-type:disc\"\u003e\r\n\t\t\t\t\t\t\t\u003cli\u003eAlergias\u003c/li\u003e\r\n\t\t\t\t\t\t\t\u003cli\u003eVacunas\u003c/li\u003e\r\n\t\t\t\t\t\t\t\u003cli\u003eMedicamentos\u003c/li\u003e\r\n\t\t\t\t\t\t\t\u003cli\u003eHistorial clínica, familiar, médica y social\u003c/li\u003e\r\n\t\t\t\t\t\t\t\u003cli\u003eVisitas a clínicas y hospitales\u003c/li\u003e\r\n\t\t\t\t\t\t\t\u003cli\u003e resultados de exámenes\u003c/li\u003e\r\n\t\t\t\t\t\t\t\u003cli\u003eDiagnósticos\u003c/li\u003e\r\n\t\t\t\t\t\t\t\u003cli\u003eProcedimientos\u003c/li\u003e\r\n\t\t\t\t\t\t\u003c/ul\u003e\r\n\t\t\t\t\t\t",
	"RecordSharingFAQText_3" : "\r\n\t\t\t\t\t\tNosotros protegemos la privacidad y la seguridad de su información cuidadosamente usando diferentes controles físicos, administrativos, y técnicos.\r\n\t\t\t\t\t\tCuando se comparte su información, su registro médico es encriptado y entregado en un formato seguro y electrónico.\r\n\t\t\t\t\t",
