	"SummaryStep" : "Rellene su visita electrónica",
	"TermsAndConditions" : "\u003ch2 class=\"header\"\u003e¿Qué es una visita electrónica?\u003c/h2\u003e\r\n\t\t\t\t\t\t\u003cp\u003e\u003c/p\u003e\r\n\t\t\t\t\t\t\u003cp class=\"bold underline\"\u003e\u003c/p\u003e\u003cp\u003eUna visita electrónica es una forma de obtener atención para ciertas afecciones sin necesidad de programar una cita o acudir a la clínica. Le haremos algunas preguntas sobre usted y sus síntomas, y un miembro de nuestro equipo de visitas electrónicas responderá con un plan de atención o recomendaciones sobre qué hacer.\u003c/p\u003e\r\n\t\t\t\t\r\n\t\t\t\t\t\t\u003ch3\u003e¿Debo usar visitas electrónicas?\u003c/h3\u003e\r\n\t\t\t\t\t\t\u003cp class=\"bold underline\"\u003e\u003c/p\u003e\r\n\t\t\t\t\t\t\u003cp\u003eLas visitas electrónicas deben usarse solo para afecciones médicas no urgentes, ya que puede tardar hasta 2 días en recibir una respuesta.\r\n\t\t\t\t\t\t\t\u003cspan class=\"bold\"\u003eSi necesita atención médica urgente, comuníquese con su clínica por teléfono o busque un centro de atención urgente cercano.\u003c/span\u003e\r\n\t\t\t\t\t\t\t\u003cspan class=\"bold abnormal\"\u003ePara emergencias médicas, llame al 911 de inmediato.\u003c/span\u003e\u003c/p\u003e\u003cp class=\"bold underline\"\u003e\r\n\t\t\t\t\t\t\u003c/p\u003e\r\n\t\t\t\t\t\t\u003cp\u003e\u003c/p\u003e\r\n\t\t\t\t\t\t\u003ch3\u003eQué esperar durante una visita electrónica:\u003c/h3\u003e\r\n\t\t\t\t\t\t\u003cp\u003eSe le puede solicitar que ingrese la información de su tarjeta de crédito antes de enviar su visita electrónica. Si se cancela la visita electrónica, se reembolsará su pago.\u003c/p\u003e\r\n\t\t\t\t\t\t\u003cp class=\"bold underline\"\u003e\u003c/p\u003e\r\n\t\t\t\t\t\t\u003cp\u003eDependiendo de los pasos presentados y las preguntas formuladas sobre sus síntomas, puede llevar de 10 a 20 minutos en completar su solicitud de visita electrónica. Es posible que le soliciten los detalles de su seguro o las listas de medicamentos. Esté preparado/a para completar esta información.\u003c/p\u003e\r\n\t\t\t\t\t\t\u003cp class=\"bold underline\"\u003e\u003c/p\u003e\u003cp\u003e\u003c/p\u003e\u003cp class=\"bold underline\"\u003e\u003c/p\u003e\r\n\t\t\t\t\t\t\u003cp\u003ePuede esperar una respuesta de nuestro personal en 1-2 días. \u003cspan class=\"bold\"\u003eSi no ha recibido una respuesta para entonces, llame a nuestra clínica al (555) 555-5555.\u003c/span\u003e\u003c/p\u003e\r\n\t\t\t\t\t\t\u003cp\u003e\u003c/p\u003e\r\n\t\t\t\t\t\t",
